import { Heading,Box } from "@chakra-ui/react";
import { motion } from "framer-motion";

const Slide = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 20 }}
    >
      <Box pos="fixed" top="200" left="30">
        <Heading  size="lg">
          Novel Cloud Storage Native Approach
        </Heading>
        <Heading size="sm">Solution Benefits</Heading>
        <Heading pos="fixed" top="250" left="30" size="sm">
          1>improved Performance
        </Heading>
        <Heading pos="fixed" top="250" left="30" size="sm">
          2>Scalability
        </Heading>
      </Box>
    </motion.div>
  );
};

export default Slide;
